import Link from 'next/link';
import MyLogo from './MyLogo';

const linkStyle = {
  marginRight: 200,
};
const Header = () => (
  <div>
    <MyLogo/>
    <Link href="/">
      <a className="home">Home</a>
    </Link>
    <Link href="/about">
      <a className="about" >About</a>
    </Link> 
    <style jsx>{`
    *{
      display: flex;
      justify-content: space-around;
      align-items: stretch;
      text-align: center;
    }
    a {
      color: white;
      text-align: center;
      text-decoration: none;
      padding: 10px 20px;
      background-color: blue;
      border: 1px solid white;
      border-radius: 30px;
    }
    `}
    </style>
  </div>
);

export default Header;
